package com.rongke.model;import com.baomidou.mybatisplus.annotations.TableField;import com.baomidou.mybatisplus.annotations.TableId;import com.baomidou.mybatisplus.annotations.TableName;import com.baomidou.mybatisplus.enums.IdType;import com.fasterxml.jackson.annotation.JsonFormat;import java.io.Serializable;import java.util.Date;/** * 在线信息 */@TableName("sys_online")public class SysOnline implements Serializable {	@TableField(exist = false)	private static final long serialVersionUID = 1L;	/**	 * @备注:	 * @字段:id BIGINT(19)	 */	@TableId(type = IdType.AUTO)	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Long id;	/**	 * 关联ID	 */	private Integer adminId;	/**	 *  登账账号	 */	private String name;	/**	 *	ip	 */	private String ip;	/**	 * ip_addr	 */	private String ipAddr;	private String sessionId;	private String token;	private Date expiredTime;	@JsonFormat(pattern = "yyyy-MM-dd HH:mm:ss",timezone = "GMT+8")	private Date createTime;	@JsonFormat(pattern = "yyyy-MM-dd HH:mm:ss",timezone = "GMT+8")	private Date updateTime;	private Integer status;	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public Integer getAdminId() {		return adminId;	}	public void setAdminId(Integer adminId) {		this.adminId = adminId;	}	public String getName() {		return name;	}	public void setName(String name) {		this.name = name;	}	public String getIp() {		return ip;	}	public void setIp(String ip) {		this.ip = ip;	}	public String getIpAddr() {		return ipAddr;	}	public void setIpAddr(String ipAddr) {		this.ipAddr = ipAddr;	}	public String getSessionId() {		return sessionId;	}	public void setSessionId(String sessionId) {		this.sessionId = sessionId;	}	public String getToken() {		return token;	}	public void setToken(String token) {		this.token = token;	}	public Date getExpiredTime() {		return expiredTime;	}	public void setExpiredTime(Date expiredTime) {		this.expiredTime = expiredTime;	}	public Date getCreateTime() {		return createTime;	}	public void setCreateTime(Date createTime) {		this.createTime = createTime;	}	public Date getUpdateTime() {		return updateTime;	}	public void setUpdateTime(Date updateTime) {		this.updateTime = updateTime;	}	public Integer getStatus() {		return status;	}	public void setStatus(Integer status) {		this.status = status;	}}